import {createRouter, createWebHistory } from "vue-router";
import Body from "@/components/Body.vue";
import Login from "@/components/Login.vue";

const routes = [
    {
        path:'/',
        name:'Home',
        component: Body,
    },
    {
        path:'/login',
        name:'Login',
        component: Login,
    }
]
createRouter({history:createWebHistory(),routes});
